                'title' => 'Kaybettiğiniz fitness motivasyonunu geri kazanın! 6 öneri',
                'slug' => 'kaybettiginiz-fitness-motivasyonunu-geri-kazanin-6-oneri',
                'summary' => 'Bir süredir fitness antrenmanlarınızı eski düzeninizde yapamıyor ya da ilk başladığınızdaki motivasyonu hissedemediğinizi düşünüyorsanız, bu önerilerimizle birlikte modunuzu tekrar yukarı çekmeye hazır olun!',
            'content' => '<p style="margin-right: auto; margin-bottom: 26px; margin-left: auto; overflow-wrap: break-word; color: rgb(34, 34, 34); font-family: Verdana, "system-ui", -apple-system, "Segoe UI", Roboto, Oxygen, Ubuntu, Cantarell, "Open Sans", "Helvetica Neue", sans-serif; font-size: 17px;">Belki iş stresi, belki özel hayatınızdaki dalgalanmalar sebebiyle alışkanlıklarınızı bir kenara bırakıp, rutininizden çıkmış olabilirsiniz. Ya da durgun bir dönemden geçiyorsunuz ve canınız hiçbir şey yapmak istemiyor. Ama hatırlatalım; bu şekilde bir yere varamazsınız. Yaşadıklarınız hayati önem arz etmediği sürece iş, stres ve buna benzer halledilebilir sorunlara karşı havlu atmayın. Her sabah yaptığınız yürüyüş ya da <span style="font-weight: 700;"><a href="https://formsante.com.tr/kategori/fitness/" target="_blank" rel="noopener noreferrer" data-wpel-link="internal" style="background-color: rgba(255, 255, 255, 0); color: rgb(77, 178, 236); pointer-events: auto;">fitness</a></span> antrenmanınızı bırakmadan, her daim motivasyonu yüksek tutmaya çalışın. Çünkü siz hareket ettikçe, daha iyi hissedeceksiniz ve her şey çok güzel olacak! Durmak, yerinde saymak hiçbir zaman iyi gelmez. Bu yüzden yarattığınız bahaneleri bir kenara bırakın ve sahip olmanız gereken, cesaretinizi ve gücünüzü ateşleyecek motivasyonu yeniden kazanmaya başlayın.</p><ul style="padding: 0px; margin-bottom: 26px; margin-left: auto; margin-right: auto; color: rgb(34, 34, 34); font-family: Verdana, "system-ui", -apple-system, "Segoe UI", Roboto, Oxygen, Ubuntu, Cantarell, "Open Sans", "Helvetica Neue", sans-serif; font-size: 17px;"><li style="line-height: inherit; margin-left: 21px; margin-bottom: 0px;"><span style="font-weight: 700;">Hedef koyun<br></span><br>Nereye gideceğiniz bilin ki emin adımlarla ilerleyin. Bir hedef koyun kendinize. Fazla kilolarınız mı var? Ya da sıkılaşmak, kas kütlenizi mi arttırmak istiyorsunuz? Her bedenin ihtiyacı ve izlemesi gereken yol farklı. Bu nedenle ilk önce bedeninizi iyice keşfedin. Girmek istediğiniz form sizi doğru yola bir adım daha yaklaştıracak. Hedefinizi belirlemek, çıkacağınız bu yoldaki zorluklarla olan mücadelenizi biraz daha azaltacak. Ulaşmak istediğiniz amacı belirledikten sonra hem antrenman hem de beslenme alışkanlıklarınızı belirleyin. İşte şimdi her şey daha kolay. Geriye sadece uygulaması kaldı, değil mi?</li></ul><p style="margin-right: auto; margin-bottom: 26px; margin-left: auto; overflow-wrap: break-word; color: rgb(34, 34, 34); font-family: Verdana, "system-ui", -apple-system, "Segoe UI", Roboto, Oxygen, Ubuntu, Cantarell, "Open Sans", "Helvetica Neue", sans-serif; font-size: 17px;"><span style="font-weight: 700;"><a href="https://formsante.com.tr/7-24-tam-motivasyon/" target="_blank" rel="noopener noreferrer" data-wpel-link="internal" style="background-color: rgba(255, 255, 255, 0); color: rgb(77, 178, 236); pointer-events: auto;">Egzersiz için 7-24 motivasyon</a><br></span></p><ul style="padding: 0px; margin-bottom: 26px; margin-left: auto; margin-right: auto; color: rgb(34, 34, 34); font-family: Verdana, "system-ui", -apple-system, "Segoe UI", Roboto, Oxygen, Ubuntu, Cantarell, "Open Sans", "Helvetica Neue", sans-serif; font-size: 17px;"><li style="line-height: inherit; margin-left: 21px; margin-bottom: 0px;"><span style="font-weight: 700;">Zorla değil, alışkanlıkla…<br></span><br>Size kimsenin zorla bir şey yaptıramayacağı konusunda aynı fikirde olduğumuzu düşünüyoruz. Kimse sizi zorla spor salonuna götüremez ya da sahilde 5K koşturamaz… Yaptığınız her şeyi kendinizi düşünerek ve her şeyden önemlisi isteyerek yapın. Zorla yaptığınız sürece hem etki alamayacaksınız hem de zamanınızı, paranızı boşa harcayacaksınız. Gerçekten istiyorsanız yapın ve bunu su içmek, yemek yemek gibi bir alışkanlık haline getirin. Bir süre sonra fark edeceksiniz ki yaptığınız aktiviteden vazgeçemeyeceksiniz. Asıl yapmadığınız zaman kendinizi kötü hissedeceksiniz.</li></ul><p style="line-height: inherit; margin-left: 21px; margin-bottom: 0px;"><img src="data:image/jpeg;base64," data-filename="2-1024x768.jpg" style="width: 50%;"></p><p style="line-height: inherit; margin-left: 21px; margin-bottom: 0px;"><br></p><p style="margin-right: auto; margin-bottom: 26px; margin-left: auto; overflow-wrap: break-word; color: rgb(34, 34, 34); font-family: Verdana, "system-ui", -apple-system, "Segoe UI", Roboto, Oxygen, Ubuntu, Cantarell, "Open Sans", "Helvetica Neue", sans-serif; font-size: 17px;"><span style="font-weight: 700;">Kendinizin en iyisi olun<br></span><br>Her beden özeldir, her vücudun kendine göre güzellikleri ve kusurları vardır. İşe ilk olarak bedenizi sevmekten başlayın. Kendinizi, sahip olduğunuz uzuvları sevmeden mutlu biri olmanız neredeyse imkansız. Aynı zamanda kabul edin. Kusurlarınızı sevin. Çünkü mükemmel olmak diye bir şey yok. Koyduğunuz hedefte kendinizin en iyisi olmaya çalışın. Rekabet etmeye, başkasının bacaklarına sahip olmayı hayal etmeye ya da hiçbir zaman inemeyeceğiniz kilolara ulaşmaya ne gerek var? Bu sadece ruhunuzu yorar. Kendinizi olduğu gibi kabul edip, sınırlarınızı zorlayarak tek rakibiniz kendiniz olun. Düzenli antrenman ve beslenme ile istediğiniz vücuda kavuşmanız kolay olacak. Yeter ki pes etmeden çalışmaya devam edin. Süreklilik sağlayın. Ufak bir not; kimseyle kendinizi karşılaştırmadığınız sürece başarılı olacaksınız.</p><ul style="padding: 0px; margin-bottom: 26px; margin-left: auto; margin-right: auto; color: rgb(34, 34, 34); font-family: Verdana, "system-ui", -apple-system, "Segoe UI", Roboto, Oxygen, Ubuntu, Cantarell, "Open Sans", "Helvetica Neue", sans-serif; font-size: 17px;"><li style="line-height: inherit; margin-left: 21px; margin-bottom: 0px;"><span style="font-weight: 700;">Örnek alın<br></span></li></ul><p style="margin-right: auto; margin-bottom: 26px; margin-left: auto; overflow-wrap: break-word; color: rgb(34, 34, 34); font-family: Verdana, "system-ui", -apple-system, "Segoe UI", Roboto, Oxygen, Ubuntu, Cantarell, "Open Sans", "Helvetica Neue", sans-serif; font-size: 17px;">Siz spor yapıp, sağlıklı beslendikçe etrafınızdakiler de sizi örnek almaya başlayacak! Gösterdiğiniz düzenli yaşam standartlarıyla çevrenizdekiler sizden görüp, sizin gibi yaşamaya çalışabilir. Çünkü bu, sizin sportif yaşamınızla ne kadar mutlu olduğunuzu görebilmeleri demek… İlham perisi olmak, birilerini güzel yaşamaya teşvik edebilmek sizi de motive edecek, hayatınıza daha da önem vermenizi sağlayacak… Bir taşla iki kuş!</p><p style="margin-right: auto; margin-bottom: 26px; margin-left: auto; overflow-wrap: break-word; color: rgb(34, 34, 34); font-family: Verdana, "system-ui", -apple-system, "Segoe UI", Roboto, Oxygen, Ubuntu, Cantarell, "Open Sans", "Helvetica Neue", sans-serif; font-size: 17px;"><img src="data:image/jpeg;base64," data-filename="3-1024x768.jpg" style="width: 50%;"></p><ul style="padding: 0px; margin-bottom: 26px; margin-left: auto; margin-right: auto; color: rgb(34, 34, 34); font-family: Verdana, "system-ui", -apple-system, "Segoe UI", Roboto, Oxygen, Ubuntu, Cantarell, "Open Sans", "Helvetica Neue", sans-serif; font-size: 17px;"><li style="line-height: inherit; margin-left: 21px; margin-bottom: 0px;"><span style="font-weight: 700;">Doğada vakit geçirin</span></li></ul><p style="margin-right: auto; margin-bottom: 26px; margin-left: auto; overflow-wrap: break-word; color: rgb(34, 34, 34); font-family: Verdana, "system-ui", -apple-system, "Segoe UI", Roboto, Oxygen, Ubuntu, Cantarell, "Open Sans", "Helvetica Neue", sans-serif; font-size: 17px;">Oksijen gibisi var mı? Yaz, kış, bahar… Mevsim ne olursa olsun, doğada olmak iyi hissettiriyor. Sessizliği, yeşilliği, su kenarı, yağmuru, güneşi derken aslında en büyük kaçışımız oluyor. Hava koşullarına uygun olarak fitness antrenmanlarınızı, koşularınızı ya da yürüyüşlerinizi doğanın kalbinde yaparak hem bedeninizi hem de ruhunuzu besleyebilirsiniz. Her şekilde iyi geleceğini garanti ediyoruz!</p><ul style="padding: 0px; margin-bottom: 26px; margin-left: auto; margin-right: auto; color: rgb(34, 34, 34); font-family: Verdana, "system-ui", -apple-system, "Segoe UI", Roboto, Oxygen, Ubuntu, Cantarell, "Open Sans", "Helvetica Neue", sans-serif; font-size: 17px;"><li style="line-height: inherit; margin-left: 21px; margin-bottom: 0px;"><span style="font-weight: 700;">Sonunda iyi hissedeceksiniz<br></span></li></ul><p style="margin-right: auto; margin-bottom: 26px; margin-left: auto; overflow-wrap: break-word; color: rgb(34, 34, 34); font-family: Verdana, "system-ui", -apple-system, "Segoe UI", Roboto, Oxygen, Ubuntu, Cantarell, "Open Sans", "Helvetica Neue", sans-serif; font-size: 17px;">Gün içinde yaşadığınız duygu durumlarının değişkenliği yüzünden antrenman yapmak istemediğiniz zamanlar olabilir. Böyle durumlarda “Kim uğraşacak şimdi?” ya da “Çok yorgunum, halim yok” gibi bahanesi bol cümleler ağızlara sakız oluyor. Haklı olabilirsiniz! Ancak antrenman yaptıktan, bolca hareket ettikten sonra gelen hissi şimdi bir düşünün. Salgıladığınız serotonin ve endorfin hormonlarıyla bir anda kendinizi yenilenmiş gibi hissetmiyor musunuz? Kendinizi antrenman yapmaya hazır hissetmediğiniz an bir düşünün: “Bittiğinde çok iyi hissedeceğim ve bu yorgunluğumdan, kafamdaki dağınıklıktan eser kalmayacak…” diyerek işe başlayın.</p><p style="margin-right: auto; margin-bottom: 26px; margin-left: auto; overflow-wrap: break-word;"><font color="#222222" face="Verdana, system-ui, -apple-system, Segoe UI, Roboto, Oxygen, Ubuntu, Cantarell, Open Sans, Helvetica Neue, sans-serif"><span style="font-size: 17px;"><iframe width="560" height="315" src="https://www.youtube.com/embed/e76d9uY1Oh4?si=r_uSSfM9wjK_4eIZ" title="YouTube video player" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share" referrerpolicy="strict-origin-when-cross-origin" allowfullscreen></iframe></span></font></p>',
